import React, { useState, useEffect } from 'react';
import { motion, AnimatePresence, useScroll, useTransform } from 'framer-motion';
import { FiSearch, FiTag, FiMapPin, FiBriefcase, FiClock, FiFilter, FiMonitor, FiGlobe, FiUsers, FiHeart, FiCalendar, FiDollarSign } from 'react-icons/fi';
import './EventsList.css';
import { Link } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';

const EventsList = () => {
    const [events, setEvents] = useState([]);
    const [loading, setLoading] = useState(true);
    const [searchTerm, setSearchTerm] = useState('');
    const [selectedType, setSelectedType] = useState('all');
    const [selectedTechStack, setSelectedTechStack] = useState('all');
    const [selectedFormat, setSelectedFormat] = useState('all');
    const [showFilters, setShowFilters] = useState(false);
    const { isAuthenticated } = useAuth();
    const { scrollYProgress } = useScroll();
    const opacity = useTransform(scrollYProgress, [0, 0.2], [1, 0]);

    const techStacks = [
        'all',
        'Web Development',
        'Mobile Development',
        'Cloud Computing',
        'DevOps',
        'Data Science',
        'Machine Learning',
        'Blockchain',
        'Cybersecurity',
        'UI/UX Design',
        'Game Development',
        'IoT',
        'AR/VR'
    ];

    const eventTypes = [
        'all',
        'Conference',
        'Hackathon',
        'Workshop',
        'Meetup',
        'Webinar',
        'Tech Talk'
    ];

    const formatOptions = [
        'all',
        'In-Person',
        'Virtual',
        'Hybrid'
    ];

    useEffect(() => {
        fetchEvents();
    }, []);

    const fetchEvents = async () => {
        try {
            const response = await fetch('http://localhost:8000/events');
            const data = await response.json();
            setEvents(data);
        } catch (error) {
            console.error('Error fetching events:', error);
        } finally {
            setLoading(false);
        }
    };

    const handleLike = async (eventId) => {
        try {
            const response = await fetch(`http://localhost:8000/events/${eventId}/like`, {
                method: 'POST'
            });
            if (response.ok) {
                fetchEvents();
            }
        } catch (error) {
            console.error('Error liking event:', error);
        }
    };

    const handleRegister = async (eventId) => {
        try {
            const response = await fetch(`http://localhost:8000/events/${eventId}/register`, {
                method: 'POST'
            });
            if (response.ok) {
                fetchEvents();
            }
        } catch (error) {
            console.error('Error registering for event:', error);
        }
    };

    const filteredEvents = events.filter(event => {
        const matchesSearch = event.title.toLowerCase().includes(searchTerm.toLowerCase()) ||
            event.description.toLowerCase().includes(searchTerm.toLowerCase()) ||
            event.organization.toLowerCase().includes(searchTerm.toLowerCase());
        const matchesType = selectedType === 'all' || event.type === selectedType;
        const matchesTechStack = selectedTechStack === 'all' || event.tech_stack.includes(selectedTechStack);
        const matchesFormat = selectedFormat === 'all' || 
            (selectedFormat === 'Virtual' && event.virtual) ||
            (selectedFormat === 'In-Person' && !event.virtual) ||
            (selectedFormat === 'Hybrid' && event.virtual && event.venue);
        return matchesSearch && matchesType && matchesTechStack && matchesFormat;
    });

    const eventVariants = {
        hidden: { opacity: 0, y: 20, scale: 0.95 },
        visible: { opacity: 1, y: 0, scale: 1 },
        exit: { opacity: 0, y: -20, scale: 0.95 },
        hover: { y: -5, scale: 1.02 }
    };

    const filterVariants = {
        hidden: { opacity: 0, height: 0 },
        visible: { opacity: 1, height: 'auto' }
    };

    return (
        <div className="events-container">
            <motion.div 
                className="events-header"
                initial={{ opacity: 0, y: -20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5 }}
                style={{ opacity }}
            >
                <motion.h1
                    initial={{ opacity: 0, y: -20 }}
                    animate={{ opacity: 1, y: 0 }}
                    transition={{ delay: 0.2 }}
                >
                    Tech Events
                </motion.h1>
                <motion.p
                    initial={{ opacity: 0, y: -20 }}
                    animate={{ opacity: 1, y: 0 }}
                    transition={{ delay: 0.3 }}
                >
                    Discover and join exciting tech events, conferences, and meetups
                </motion.p>
            </motion.div>

            <motion.div 
                className="search-filters"
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ delay: 0.2 }}
            >
                <div className="search-box">
                    <FiSearch className="search-icon" />
                    <input
                        type="text"
                        placeholder="Search events..."
                        value={searchTerm}
                        onChange={(e) => setSearchTerm(e.target.value)}
                    />
                </div>
                <motion.button
                    className="filter-toggle"
                    onClick={() => setShowFilters(!showFilters)}
                    whileHover={{ scale: 1.05 }}
                    whileTap={{ scale: 0.95 }}
                >
                    <FiFilter className="filter-icon" />
                    Filters
                </motion.button>
            </motion.div>

            <AnimatePresence>
                {showFilters && (
                    <motion.div
                        className="advanced-filters"
                        variants={filterVariants}
                        initial="hidden"
                        animate="visible"
                        exit="hidden"
                    >
                        <div className="filter-section">
                            <h3>Event Type</h3>
                            <div className="filter-options">
                                {eventTypes.map((type) => (
                                    <button
                                        key={type}
                                        className={`filter-option ${selectedType === type ? 'active' : ''}`}
                                        onClick={() => setSelectedType(type)}
                                    >
                                        <FiBriefcase /> {type}
                                    </button>
                                ))}
                            </div>
                        </div>

                        <div className="filter-section">
                            <h3>Tech Stack</h3>
                            <div className="filter-options">
                                {techStacks.map((tech) => (
                                    <button
                                        key={tech}
                                        className={`filter-option ${selectedTechStack === tech ? 'active' : ''}`}
                                        onClick={() => setSelectedTechStack(tech)}
                                    >
                                        <FiMonitor /> {tech}
                                    </button>
                                ))}
                            </div>
                        </div>

                        <div className="filter-section">
                            <h3>Format</h3>
                            <div className="filter-options">
                                {formatOptions.map((format) => (
                                    <button
                                        key={format}
                                        className={`filter-option ${selectedFormat === format ? 'active' : ''}`}
                                        onClick={() => setSelectedFormat(format)}
                                    >
                                        {format === 'Virtual' ? <FiGlobe /> : <FiMapPin />} {format}
                                    </button>
                                ))}
                            </div>
                        </div>
                    </motion.div>
                )}
            </AnimatePresence>

            {loading ? (
                <div className="loading-spinner">
                    <div className="spinner"></div>
                </div>
            ) : (
                <AnimatePresence>
                    <div className="events-grid">
                        {filteredEvents.map((event) => (
                            <motion.div
                                key={event.id}
                                className="event-card"
                                variants={eventVariants}
                                initial="hidden"
                                animate="visible"
                                exit="exit"
                                whileHover="hover"
                            >
                                <div className="event-header">
                                    <h3>{event.title}</h3>
                                    <span className={`type-badge ${event.type.toLowerCase()}`}>
                                        {event.type}
                                    </span>
                                </div>
                                <div className="event-org">
                                    <FiBriefcase className="icon" />
                                    <span>{event.organization}</span>
                                </div>
                                <div className="event-details">
                                    <div className="event-location">
                                        {event.virtual ? <FiGlobe className="icon" /> : <FiMapPin className="icon" />}
                                        <span>{event.virtual ? 'Virtual Event' : event.location}</span>
                                    </div>
                                    <div className="event-date">
                                        <FiCalendar className="icon" />
                                        <span>{new Date(event.start_date).toLocaleDateString()}</span>
                                    </div>
                                    {event.price && (
                                        <div className="event-price">
                                            <FiDollarSign className="icon" />
                                            <span>{event.price}</span>
                                        </div>
                                    )}
                                </div>
                                <p className="event-description">
                                    {event.description}
                                </p>
                                <div className="event-tech-stack">
                                    {event.tech_stack.map((tech, index) => (
                                        <motion.span
                                            key={index}
                                            className="tech-badge"
                                            whileHover={{ scale: 1.1 }}
                                            whileTap={{ scale: 0.95 }}
                                        >
                                            <FiMonitor className="tech-icon" />
                                            {tech}
                                        </motion.span>
                                    ))}
                                </div>
                                <div className="event-tags">
                                    {event.tags.map((tag, index) => (
                                        <motion.span
                                            key={index}
                                            className="tag"
                                            whileHover={{ scale: 1.1 }}
                                            whileTap={{ scale: 0.95 }}
                                        >
                                            <FiTag className="tag-icon" />
                                            {tag}
                                        </motion.span>
                                    ))}
                                </div>
                                <div className="event-footer">
                                    <div className="event-stats">
                                        <button 
                                            className="like-button" 
                                            onClick={() => handleLike(event.id)}
                                        >
                                            <FiHeart className="icon" />
                                            <span>{event.likes}</span>
                                        </button>
                                        <div className="attendees">
                                            <FiUsers className="icon" />
                                            <span>{event.attendees} attending</span>
                                        </div>
                                    </div>
                                    <motion.button
                                        className="register-button"
                                        onClick={() => handleRegister(event.id)}
                                        whileHover={{ scale: 1.05 }}
                                        whileTap={{ scale: 0.95 }}
                                    >
                                        Register Now
                                    </motion.button>
                                </div>
                            </motion.div>
                        ))}
                    </div>
                </AnimatePresence>
            )}
        </div>
    );
};

export default EventsList;
